import React from 'react';

const Header = () => {
    const boxStyle = {
        backgroundColor: '#8B4513',
        color: '#ffffff',
        padding: '20px',
        borderRadius: '10px',
        textAlign: 'center',
    };

    return (
        <div id="head" style={boxStyle}>
            <h1>Bienvenido</h1>
        </div>
    );
};

export default Header;
